<p-toast position="top-center" key="msg5"></p-toast>
<div class="container">
  <div class="tab-container">
    <div class="list-med">
      <h2>Laboratories</h2>
      <hr />
      <p-table
        #dt1
        [value]="laboratories"
        dataKey="id"
        [rows]="10"
        [showCurrentPageReport]="true"
        [rowsPerPageOptions]="[10, 25, 50]"
        [paginator]="true"
        currentPageReportTemplate="Showing {first} to {last} of {totalRecords} entries"
      >
        <ng-template pTemplate="caption">
          <div class="flex">
            <span class="p-input-icon-left ml-auto">
              <i class="pi pi-search"></i>
              <input
                pInputText
                type="text"
                placeholder="Search keyword"
                [(ngModel)]="searchTerm"
                (input)="filterTable()"
              />
            </span>
          </div>
        </ng-template>
        <ng-template pTemplate="header">
          <tr>
            <th pSortableColumn="name" style="width: 15%">
              Email<p-sortIcon field="name"></p-sortIcon>
            </th>
            <th pSortableColumn="price" style="width: 20%">
              Name<p-sortIcon field="price"></p-sortIcon>
            </th>
            <th pSortableColumn="quantity" style="width: 15%">
              Address<p-sortIcon field="quantity"></p-sortIcon>
            </th>
          </tr>
        </ng-template>
        <ng-template pTemplate="body" let-lab>
          <tr>
            <td>{{ lab.email }}</td>
            <td>{{ lab.name }}</td>
            <td>{{ lab.address }}</td>
          </tr>
        </ng-template>
        <ng-template pTemplate="emptymessage">
          <tr>
            <td colspan="5" style="text-align: center">
              Nothing to display yet.
            </td>
          </tr>
        </ng-template>
      </p-table>
    </div>
  </div>
  <div class="image-container">
    <svg
      class="animated"
      id="freepik_stories-laboratory"
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 500 500"
      version="1.1"
      xmlns:xlink="http://www.w3.org/1999/xlink"
      xmlns:svgjs="http://svgjs.com/svgjs"
    >
      <style>
        svg#freepik_stories-laboratory:not(.animated) .animable {
          opacity: 0;
        }
        svg#freepik_stories-laboratory.animated
          #freepik--background-simple--inject-55 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomIn;
          animation-delay: 0s;
        }
        svg#freepik_stories-laboratory.animated #freepik--Equipment--inject-55 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            lightSpeedLeft;
          animation-delay: 0s;
        }
        svg#freepik_stories-laboratory.animated #freepik--Device--inject-55 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
          animation-delay: 0s;
        }
        svg#freepik_stories-laboratory.animated
          #freepik--characters-2--inject-55 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            slideDown;
          animation-delay: 0s;
        }
        svg#freepik_stories-laboratory.animated
          #freepik--character-1--inject-55 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
            lightSpeedRight;
          animation-delay: 0s;
        }
        svg#freepik_stories-laboratory.animated #freepik--Bottles--inject-55 {
          animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) fadeIn;
          animation-delay: 0s;
        }
        @keyframes zoomIn {
          0% {
            opacity: 0;
            transform: scale(0.5);
          }
          100% {
            opacity: 1;
            transform: scale(1);
          }
        }
        @keyframes lightSpeedLeft {
          from {
            transform: translate3d(-50%, 0, 0) skewX(20deg);
            opacity: 0;
          }
          60% {
            transform: skewX(-10deg);
            opacity: 1;
          }
          80% {
            transform: skewX(2deg);
          }
          to {
            opacity: 1;
            transform: translate3d(0, 0, 0);
          }
        }
        @keyframes slideUp {
          0% {
            opacity: 0;
            transform: translateY(30px);
          }
          100% {
            opacity: 1;
            transform: inherit;
          }
        }
        @keyframes slideDown {
          0% {
            opacity: 0;
            transform: translateY(-30px);
          }
          100% {
            opacity: 1;
            transform: translateY(0);
          }
        }
        @keyframes lightSpeedRight {
          from {
            transform: translate3d(50%, 0, 0) skewX(-20deg);
            opacity: 0;
          }
          60% {
            transform: skewX(10deg);
            opacity: 1;
          }
          80% {
            transform: skewX(-2deg);
          }
          to {
            opacity: 1;
            transform: translate3d(0, 0, 0);
          }
        }
        @keyframes fadeIn {
          0% {
            opacity: 0;
          }
          100% {
            opacity: 1;
          }
        }
      </style>
